import React, { useEffect, useState } from 'react';
import fetch_token from './fetch_token.js'; // 导入 fetch_token 函数
import fetch_calendar from './calendar.js';

const App = () => {
  const username = "test08"; // 假设的用户名
  const team = "김천"; // 假设的团队名
  const [token, setToken] = useState('');
  const [calendar_data, setCalendarData] = useState('');

  useEffect(() => {
    const getTokenInfo = async () => {
      if(!token) {
        fetch_token(username, team);
        setToken(localStorage.getItem('token'));
      }
    };

    getTokenInfo(); // 调用获取 token 的函数
  }, []); // 只在组件挂载时调用

  useEffect(() => {
    const getcalendarInfo = async () => {
      if(!token) {
        setCalendarData(fetch_calendar(token));
      }
    };

    getcalendarInfo(); 
  }, []); // 只在组件挂载时调用

  return (
    <div>
      <h3>Information</h3>
      <p>Token: {token}</p>

      <h3>Past Events</h3>
      <p>Token: {calendar_data}</p>
    </div>
  );
};

export default App;
